import React, { useState } from 'react';
import { TextField, Button, Box } from '@mui/material';
import './Checkout.css';

const Checkout = ({ totalCartValue, isCartEmpty, navigateToOrder }) => {
    const [formData, setFormData] = useState({
        name: '',
        phone: '',
        email: '',
        city: '',
        address: '',
        zipCode: '',
        instructions: '',
    });

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleFormSubmit = () => {
        if (!isCartEmpty) {
            console.log('User Delivery Details:', formData);
            navigateToOrder();
        }
    };

    // Shared sx styles for all TextFields
    const textFieldStyles = {
        '& .MuiInputLabel-root': {
            textAlign: 'right',
            right: 0,
            transformOrigin: 'top right',
        },
        '& .MuiInputBase-input': {
            textAlign: 'right',
        },
    };

    const totalPayment = (totalCartValue) => totalCartValue + 35;

    const handlePayment = () => {
        const PAYPAL_SCRIPT_URL = `https://www.paypal.com/sdk/js?client-id=Aaj4iB9K3iSqhCt5suzrRxfiXOMjnZkEitBR-GOBJVIEFuIrLKxZETZILv6MClHS_efn2sI-phA6nQSe&currency=ILS`;

        // Dynamically load PayPal SDK
        const script = document.createElement('script');
        script.src = PAYPAL_SCRIPT_URL;
        script.onload = () => {
            window.paypal.Buttons({
                style: {
                    layout: 'horizontal', // Customize button style
                },
                createOrder: (data, actions) => {
                    // Create the order
                    return actions.order.create({
                        purchase_units: [{
                            amount: {
                                value: {totalPayment}, // Replace with total cart amount
                            },
                        }],
                    });
                },
                onApprove: (data, actions) => {
                    // Capture the payment
                    return actions.order.capture().then((details) => {
                        alert('Transaction completed by ' + details.payer.name.given_name);
                    });
                },
                onError: (err) => {
                    console.error(err);
                    alert('Payment failed!');
                },
                fundingSource: window.paypal.FUNDING.CARD, // Ensure only credit card
            })
        };
        document.body.appendChild(script);
    };

    return (
        <div className="checkout-section">
            <h2>פרטי משלוח</h2>
            <Box 
                className="checkout-customer-details" 
                component="form" 
                sx={{ display: 'flex', flexDirection: 'column', gap: 2, width: '80%', margin: '0 auto', mb: 10}}
            >
                <TextField
                    name="name"
                    label="שם מלא"
                    variant="standard"
                    value={formData.name}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="phone"
                    label="טלפון"
                    variant="standard"
                    value={formData.phone}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="email"
                    label="דוא״ל"
                    variant="standard"
                    value={formData.email}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="city"
                    label="עיר"
                    variant="standard"
                    value={formData.city}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="address"
                    label="כתובת"
                    variant="standard"
                    value={formData.address}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="zipCode"
                    label="מיקוד"
                    variant="standard"
                    value={formData.zipCode}
                    onChange={handleInputChange}
                    fullWidth
                    sx={textFieldStyles}
                />
                <TextField
                    name="instructions"
                    label="הוראות"
                    variant="standard"
                    value={formData.instructions}
                    onChange={handleInputChange}
                    multiline
                    rows={4}
                    fullWidth
                    sx={textFieldStyles}
                />
            </Box>

            <div className="checkout-total">
                <div>
                    <span>סה"כ מחיר בעגלה:</span>
                    <span>₪{totalCartValue}</span>
                </div>
                <div>
                    <span>סה"כ מחיר משלוח:</span>
                    <span>₪35.00</span>
                </div>
                <div className="checkout-total-payment">
                    <span>סה"כ לתשלום:</span>
                    <span>₪{totalPayment(totalCartValue)}</span>
                </div>
            </div>

            <div className="checkout-button-container">
                <Button
                    className="checkout-button"
                    onClick={handlePayment}
                    disabled={isCartEmpty}
                    variant="contained"
                    color="primary"
                >
                    המשך לתשלום
                </Button>
            </div>

        </div>
    );
};

export default Checkout;
